webpackJsonp([0xbad44fed20fd],{391:function(A,e){A.exports={data:{site:{siteMetadata:{title:"keto.nyc",author:"Una Kravets"}},markdownRemark:{id:"/Users/unakravets/Dev/keto.nyc/src/pages/2018-07-22-cheesecake-cupcakes/index.md absPath of file >>> MarkdownRemark",html:'<h2>Youâ€™ll Need:</h2>\n<ul>\n<li>1/2 cup almond flour</li>\n<li>1/4 cup (1/2 stick) melted butter</li>\n<li>2 (8 ounce) packages of cream cheese, softened</li>\n<li>2 eggs</li>\n<li>3/4 cup <a href="https://amzn.to/2OwdAZD">erythritol sweetener</a></li>\n<li>1 teaspoon vanilla extract</li>\n<li>4 large strawberries, sliced</li>\n<li>Sugar-free whipped heavy cream (love <a href="https://www.landolakes.com/products/whipping-cream-and-half-half/aerosol-whipped-cream/">this</a> stuff!)</li>\n</ul>\n<h2>Directions:</h2>\n<ol>\n<li>Preheat oven to 350 degrees F (175 degrees C). Line 12 muffin cups with paper liners</li>\n<li>Mix almond flour and butter together in a bowl, spoon into the bottom of the paper liners and press into a flat crust</li>\n<li>Beat cream cheese, eggs, erythritol, and vanilla extract together in a bowl until smooth; spoon into the muffin cups</li>\n<li>Bake in the preheated oven until the cream cheese mixture is nearly set in the middle, (15 to 18 minutes)</li>\n<li>Let cupcakes cool at room temperature until cool enough to handle. Refrigerate 8 hours to overnight before serving.</li>\n<li>When the cupcakes are set, apply a thin coating of whipped cream and lay the sliced strawberries on top</li>\n<li>Top it off with more whipped cream!</li>\n</ol>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/IMG_1366-b99fd9f6c27c331bdf449307d8c9bb64-8c50e.jpg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 590px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.69921875%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="IMG 1366"\n        title=""\n        src="/static/IMG_1366-b99fd9f6c27c331bdf449307d8c9bb64-f8fb9.jpg"\n        srcset="/static/IMG_1366-b99fd9f6c27c331bdf449307d8c9bb64-e8976.jpg 148w,\n/static/IMG_1366-b99fd9f6c27c331bdf449307d8c9bb64-63df2.jpg 295w,\n/static/IMG_1366-b99fd9f6c27c331bdf449307d8c9bb64-f8fb9.jpg 590w,\n/static/IMG_1366-b99fd9f6c27c331bdf449307d8c9bb64-85e3d.jpg 885w,\n/static/IMG_1366-b99fd9f6c27c331bdf449307d8c9bb64-8c50e.jpg 1024w"\n        sizes="(max-width: 590px) 100vw, 590px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>',frontmatter:{date:"July 22, 2018",protein:0,funFact:"This recipe was first made for Una's 26th birthday",servings:12,netCarbs:2.5,calories:178,fat:6,carbs:12,title:"Keto Strawberry Cheesecake Cupcakes",fiber:2,sugars:8.5,prepTime:"10 mins",cookTime:"15 mins",readyTime:"8.5 hours",image1:{childImageSharp:{resolutions:{width:683,height:1024,src:"/static/cover-6111fcc0c2f5813a8247a45c5460748d-ff52a.jpg",srcSet:"/static/cover-6111fcc0c2f5813a8247a45c5460748d-ff52a.jpg 1x"}}},image2:{childImageSharp:{resolutions:{width:683,height:1024,src:"/static/secondary-f68367dca1156ef2c4c7aa5bc141127b-ff52a.jpg",srcSet:"/static/secondary-f68367dca1156ef2c4c7aa5bc141127b-ff52a.jpg 1x"}}}}}},pathContext:{slug:"/2018-07-22-cheesecake-cupcakes/",previous:null,next:{fields:{slug:"/2018-07-29-soyrizo-scramble/"},frontmatter:{title:"Soyrizo Scramble"}}}}}});
